import './footer.css'
const Footer=(props)=>{
     return(
      <footer className='footer-text'>
        
             <p style={{position: 'absolute', top: '-6px',marginLeft:'40%'}}>Copy Right 2020 ShiroMeda. All right Reserved</p>
      
      </footer>
     )
}
export default Footer;
